import './App.css';
import Modal from './Components/Modal';
import Navbar from './Components/navbar'; 
import TextHTMLForm from './Components/TextForm'; 
function App() {
  return (
    <>
    <Navbar/>
    <TextHTMLForm input1="Email" input2="Password" input3="10th MarkSheet" input4="12th MarkSheet" input5="Resume" input6="Cover Letter"/>
    <Modal />
    </>
  );
} 
export default App;
